// src/Component/Layouts/SideBar/Sidebar.jsx
import React from 'react';
import { FaTachometerAlt, FaTruck, FaGasPump, FaCity, FaUsers, FaChartBar, FaCog, FaSignOutAlt } from "react-icons/fa";
import './Sidebar.css';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <div className="sidebar-header">
        <span className="sidebar-logo">ðŸšš</span>
        <span className="sidebar-title">OilFlow</span>
        <span className="sidebar-admin">Admin Panel</span>
      </div>
      <nav className="sidebar-nav">
        <ul>
          <li className="active"><FaTachometerAlt /> Dashboard</li>
          <li><FaTruck /> Fleet Management</li>
          <li><FaGasPump /> Oil Management</li>
          <li><FaCity /> City Operations</li>
          <li><FaUsers /> User Management</li>
          <li><FaChartBar /> Analytics</li>
          <li><FaCog /> Settings</li>
          <li><FaSignOutAlt /> Logout</li>
        </ul>
      </nav>
    </div>
  );
};

export default Sidebar;
